import React , { Components } from 'react'
import CustomerList from './CustomerList';

class CustomerData extends Components {
    constructor (props){
        super(props);
        this.state = {
          ListItems : ['Swati', 'Riddhi','Pihu','Sanjay']
        }
      }
  
    render() {
        return(
            <div> 
                <ul>
                    {this.state.ListItems.map(eachitem => <CustomerList item={eachitem}/>)}
                </ul>
            </div>
        )
    }
}

export default CustomerData
